// src/pages/AccountsPayable.jsx
import React, { useState, useEffect } from 'react';
import { CreditCard, Loader, AlertTriangle, RefreshCw } from 'lucide-react';
import APHeader from '../components/AccountsPayable/APHeader';
import APSummaryCards from '../components/AccountsPayable/APSummaryCards';
import APTabs from '../components/AccountsPayable/APTabs';
import APOverviewTab from '../components/AccountsPayable/APOverviewTab';
import APPurchaseOrdersTab from '../components/AccountsPayable/APPurchaseOrdersTab';
import APPaymentsTab from '../components/AccountsPayable/APPaymentsTab';
import APProductsTab from '../components/AccountsPayable/APProductsTab';
import VendorDetailModal from '../components/AccountsPayable/VendorDetailModal';
import PurchaseOrderModal from '../components/AccountsPayable/PurchaseOrderModal';
import { useAPData } from '../hooks/useAPData';
import { useAPFilters } from '../hooks/useAPFilters';
import { calculateAPSummary } from '../utils/apCalculations';

const AccountsPayable = () => {
  // State management
  const [activeTab, setActiveTab] = useState('overview');
  const [selectedVendor, setSelectedVendor] = useState(null);
  const [selectedPO, setSelectedPO] = useState(null);

  // Custom hooks for data management
  const {
    purchaseOrders,
    vendors,
    products,
    loading,
    error,
    refreshAllData
  } = useAPData();

  const {
    filters,
    setFilters,
    getFilteredVendors
  } = useAPFilters(vendors.data);

  // Calculations
  const summary = calculateAPSummary(vendors, purchaseOrders);
  const filteredVendors = getFilteredVendors();

  // Loading state
  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="flex items-center space-x-3">
          <Loader className="animate-spin text-rose-600" size={24} />
          <span className="text-gray-600">Loading data from API...</span>
        </div>
      </div>
    );
  }

  // Error state
  if (error) {
    return (
      <div className="max-w-7xl mx-auto p-6">
        <div className="bg-red-50 border border-red-200 rounded-lg p-6">
          <div className="flex items-center mb-4">
            <AlertTriangle className="text-red-600 mr-2" size={20} />
            <h3 className="font-medium text-red-800">API Connection Error</h3>
          </div>
          <div className="text-red-700 mb-4">
            {error}
          </div>
          <button
            onClick={refreshAllData}
            className="px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700 flex items-center space-x-2"
          >
            <RefreshCw size={16} />
            <span>Retry Connection</span>
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto p-6 bg-white">
      <APHeader />
      
      <APSummaryCards summary={summary} />
      
      <APTabs activeTab={activeTab} setActiveTab={setActiveTab} />

      {/* Tab Content */}
      {activeTab === 'overview' && (
        <APOverviewTab
          filters={filters}
          setFilters={setFilters}
          filteredVendors={filteredVendors}
          purchaseOrders={purchaseOrders}
          onVendorSelect={setSelectedVendor}
          onPOSelect={setSelectedPO}
          onRefresh={refreshAllData}
        />
      )}

      {activeTab === 'purchase-orders' && (
        <APPurchaseOrdersTab
          purchaseOrders={purchaseOrders}
          vendors={vendors}
          products={products}
          onPOSelect={setSelectedPO}
        />
      )}

      {activeTab === 'payments' && (
        <APPaymentsTab
          purchaseOrders={purchaseOrders}
          vendors={vendors}
          products={products}
        />
      )}

      {activeTab === 'products' && (
        <APProductsTab
          products={products}
        />
      )}

      {/* Modals */}
      {selectedVendor && (
        <VendorDetailModal
          vendor={selectedVendor}
          onClose={() => setSelectedVendor(null)}
          purchaseOrders={purchaseOrders}
          products={products}
        />
      )}

      {selectedPO && (
        <PurchaseOrderModal
          purchaseOrder={selectedPO}
          onClose={() => setSelectedPO(null)}
          vendors={vendors}
          products={products}
        />
      )}
    </div>
  );
};

export default AccountsPayable;
